import { Navbar,Nav,Form,Button,FormControl,Card,NavDropdown } from 'react-bootstrap';
import * as Icon from 'react-bootstrap-icons';
import './style.css';

const Headbar = () => {
  return (
    <div className="App-main">
      <Navbar bg="dark" variant="dark">
      <Navbar.Brand href="#home">KUfiber</Navbar.Brand>
      <Nav className="mr-auto" variant="pills">
      <Nav.Link href="/main">About</Nav.Link>
      <Nav.Link href="/list">List</Nav.Link>
      
      <Nav.Link href="/insert">+New</Nav.Link>
      <Nav.Link href="/addstation">+Addplace</Nav.Link>
      
      </Nav>

      <Form inline>
      <Navbar.Brand></Navbar.Brand>
      <Button variant="light" href="/private"><Icon.Power /></Button>
      </Form>
      </Navbar>
    </div>
  );
}

export default Headbar;
